(1, 1, 'Online registrace již není aktivní.', 'test competition', '0000-00-00', 'Test centrum', 'Popis závodu nu **56 hodna** dohodí rozchod pot bendou v těšilo hlučnější ne to spadnout. Pec no že ber funusy, dole služku druh strašilo vinu, břitkou, pokladen užívají čtenáři nu odlepit dušeně, vrh mi šla přízemní zisk jedni, od jo déle. Loď nim amen loď zasvé jeho zápis.\r\n\r\nZvěst sváděl stačí tichých mela ale hejdo kdy zajedu koberce ječela. Rty on amina nabídla pokusné vás červcem o žebrák obyčejné. Via bývají k krámě ani noc uznaných i rytířství. A bavil my kopl – ním jste dřevěný! Ošlapek kradu 19 eh co rozchod novém ní skleněnou vraťte lesy hlučný chalupa přísahat.', '', '', 'Popis registrace třepal neměl všelijakými klecí mé 11 řady host vstupujícího? V četné šel mat typ he aniž nim ničemu. Vytáhl per amin dán stráži začali unesl ó hanbíš. Střední úrovně, po ně 705 či žebřík volná, mi? Prahu 77 inzerátech ukazovala.', 'Popis platby ba jet hůř žádáme daří sto. S ti mi stál nu ho, ke mu suše oddychl u vykonán mi řády, 81 oč si zmačkané olezlejší. Pihy ní by 56 dá sáhl námi.\r\n- Něm dívá **zeť** dnů gramy\r\n- 56 holdují ono parohů!\r\n', 'http://www.ewitis.cz/', '000000/0800', '/gfx/stopky4_200.jpg', 41, 24, 2, NULL, 0, 0, NULL, 0, 0, NULL, 0, 0, '2012-02-22 21:40:50'),
(2, 0, 'Online registrace již není aktivní.', 'Blizák 2010', '2010-06-19', 'Sázava, okr. Benešov', 'Letos pořádáme **10. ročník** cyklistického klání, kde si dravci šáhnou na dno svých sil a přátelé náročného ježdění přírodou si užijí. Obě tratě závodu, na **40** nebo **80 km** se derou po stráních od řeky Sázavy vzhůru aby se ve sjezdech zase vracely zpět. To je prošpikováno několika brody přes sázavské přítoky, pěšinkami, lesními cestami a tu a tam nějakým asfaltem. A kdo má dost sil, užije si i krásný výhled po krajině.\r\n\r\n80 km je určeno pro cyklisty, kteří vědí jak hospodařit ze silami a mají už něco najeto. Trať kratší může ujet každý, kdo na kole rád jezdí a ví, o co při horském ježdění jde. Naši sponzoři se podílejí na tom, aby řeka a město Sázava mělo cyklistům co nabídnout. Startuje a dojíždí se ve městě Sázava, kam se dostanete z 34 km dálnice D1. V cíli je dostatek stínu, občerstvení, a pro vítěze hodnotné ceny. O to, aby vše proběhlo v pořádku se stará 130 pořadatelů a jedna nebo tři občerstvovací stanice – podle délky tratě. Každý, kdo může se na tento závod každý rok vrací.', 'Výsledky jsou k dispozici <a href="http://blizak.cz/?p=vysledky">na stránkách závodu</a>', '<iframe src="http://www.rajce.net/a3636593/mini?bgcolor=&photoNameVisible=0" name="rajce-net" width="356" height="356" frameborder="0" scrolling="no" allowtransparency="false"></iframe>', 'Podrobné informace o registraci najdete v "**prozicích závodu**":http://www.blizak.cz/files/Blizak_2010_propozice.pdf \r\n\r\nPro předem přihlášené závodníky se zaplacením do 09.06.2010 triko s logem Blizák zdarma.', 'Pro určení výše startovného je rozhodující datum zaplacení.\r\n- **cena 1** platí **do 9.6. 2010**\r\n- **cena 2** potom **od 10.6. 2010.**\r\n', 'http://www.blizak.cz/', '1597379053/0800', '/img/blizak/bcg-2010_vyrez.jpg', 327, 1000, 2, 'Adresa <br/><span>(město, ulice, psč)</span>', 1, 0, 'Cykloklub', 0, 1, NULL, 0, 0, '2012-02-21 22:31:02'),
(3, 0, 'Online registrace již není aktivní.\r\n\r\nStále je možné se registrovat v místě závodu více viz "**prozice závodu**":http://www.blizak.cz/files/Blizak_2011_propozice.pdf', 'Blizák 2011', '2011-06-18', 'Sázava, okr. Benešov', 'Letos pořádáme **11. ročník** cyklistického klání, kde si dravci šáhnou na dno svých sil a přátelé náročného ježdění přírodou si užijí. Obě tratě závodu, na **40** nebo **80 km** se derou po stráních od řeky Sázavy vzhůru aby se ve sjezdech zase vracely zpět. To je prošpikováno několika brody přes sázavské přítoky, pěšinkami, lesními cestami a tu a tam nějakým asfaltem. A kdo má dost sil, užije si i krásný výhled po krajině.\r\n\r\n80 km je určeno pro cyklisty, kteří vědí jak hospodařit ze silami a mají už něco najeto. Trať kratší může ujet každý, kdo na kole rád jezdí a ví, o co při horském ježdění jde. Naši sponzoři se podílejí na tom, aby řeka a město Sázava mělo cyklistům co nabídnout. Startuje a dojíždí se ve městě Sázava, kam se dostanete z 34 km dálnice D1. V cíli je dostatek stínu, občerstvení, a pro vítěze hodnotné ceny. O to, aby vše proběhlo v pořádku se stará 130 pořadatelů a jedna nebo tři občerstvovací stanice – podle délky tratě. Každý, kdo může se na tento závod každý rok vrací.', 'Výsledky jsou k dispozici <a href="http://blizak.cz/?p=vysledky">na stránkách závodu</a>', '<iframe src="http://www.rajce.net/a5020899/mini?bgcolor=&photoNameVisible=0" name="rajce-net" width="356" height="356" frameborder="0" scrolling="no" allowtransparency="false"></iframe>\r\n\r\n<iframe src="http://www.rajce.net/a5009320/mini?bgcolor=&photoNameVisible=0" name="rajce-net" width="356" height="356" frameborder="0" scrolling="no" allowtransparency="false"></iframe>\r\n\r\n<iframe src="http://www.rajce.net/a5125217/mini?bgcolor=&photoNameVisible=0" name="rajce-net" width="356" height="356" frameborder="0" scrolling="no" allowtransparency="false"></iframe>', 'Podrobné informace o registraci najdete v "**prozicích závodu**":http://www.blizak.cz/files/Blizak_2011_propozice.pdf \r\n\r\n', '\r\n', 'http://www.blizak.cz/', 'Platba na místě', '/img/blizak/blizak_2011_vyrez_small.jpg', 292, 1000, 1, 'Adresa <br/><span>(město, ulice, psč)</span>', 1, 0, 'Cykloklub', 0, 1, NULL, 0, 0, '2012-02-21 22:30:25'),
(4, 0, 'Online registrace již není aktivní.', 'Kralovický MTB Maraton', '2011-08-27', 'Kralovice, okr. Plzeň - sever', 'Vážení bikeři a milovníci kol,\r\npo dohodě realizačně organizačního týmu, začali na plno přípravy již 8.ročníku Maratonu horských kol. \r\n \r\nTrať by neměla doznat výrazných změn, upravena bude pouze střední trasa, pro svoji velkou náročnost\r\na přiblížení více méně náročným bikerům.\r\nDíle pracujeme na zlepšení zázemí jak v prostorech startu a cíle, tak i na občerstvovacích stanicích, \r\na vylepšením značení tras.\r\nVěříme že u nyní se máte opět na co těšit, začněte proto s tréninkem již nyní!!\r\n \r\nJako každoročně nabízíme  všem fyzickým i právnickým subjektům možnost prezentace prostřednictvím tohoto podniku, \r\nať už formou přímé pomoci s realizací a organizací či formou podpory věcnou či finanční. \r\nInformace v krátké době zde, či na kontaktním tel. čísle.  ', 'Skupiny\r\n======================\r\n\r\n- "Skupina A 90KM":[http://ewitis.cz/competitions/2011_kralovice/90km.pdf]\r\n- "Skupina B 50KM":[http://ewitis.cz/competitions/2011_kralovice/50km.pdf]\r\n- "Skupina C 25KM":[http://ewitis.cz/competitions/2011_kralovice/25km.pdf]\r\n\r\n\r\nKategorie\r\n======================\r\n\r\n- "Kategorie DMH19":[http://ewitis.cz/competitions/2011_kralovice/DMH19.pdf]\r\n- "Kategorie DM30":[http://ewitis.cz/competitions/2011_kralovice/DM30.pdf]\r\n- "Kategorie DM40":[http://ewitis.cz/competitions/2011_kralovice/DM40.pdf]\r\n- "Kategorie DM50+":[http://ewitis.cz/competitions/2011_kralovice/DM50plus.pdf]\r\n- "Kategorie DŽ19+":[http://ewitis.cz/competitions/2011_kralovice/DZ19plus.pdf]\r\n\r\n\r\n- "Kategorie KMH19":[http://ewitis.cz/competitions/2011_kralovice/KMH19.pdf]\r\n- "Kategorie KM30":[http://ewitis.cz/competitions/2011_kralovice/KM30.pdf]\r\n- "Kategorie KM40":[http://ewitis.cz/competitions/2011_kralovice/KM40.pdf]\r\n- "Kategorie KM50+":[http://ewitis.cz/competitions/2011_kralovice/KM50plus.pdf]\r\n- "Kategorie KŽ19+":[http://ewitis.cz/competitions/2011_kralovice/KZ19plus.pdf]\r\n- "Kategorie KM16":[http://ewitis.cz/competitions/2011_kralovice/KM16.pdf]\r\n\r\n\r\n- "Kategorie Ženy 25KM":[http://ewitis.cz/competitions/2011_kralovice/ZENY_25km.pdf]\r\n- "Kategorie Muži 25KM":[http://ewitis.cz/competitions/2011_kralovice/MUZI_25km.pdf]\r\n\r\n\r\n', '', 'Podrobné informace o registraci najdete v "**prozicích závodu**":http://bck.webnode.cz/propozice/', 'Pro určení výše startovného je rozhodující datum zaplacení.\r\n- **cena 1** platí do uzávěrky online přihlášení, tedy **do 11.8. 2011**\r\n- **cena 2** potom po uzávěrce a při přihlášení na místě\r\n\r\nStartovné zahrnuje občerstvovací stanice na trati, upomínkový předmět, zdravotní a pořadatelskou službu, měření času a zpracování výsledků, pamětní startovní číslo, lístek do tomboly.\r\n\r\nObčerstvení v cíli - teplé jídlo jen pro předem přihlášené\r\nostatní - jídlo studené.\r\n\r\nZrušit zaplacené startovné je možné pouze písemně s datem odeslání nejpozději v den konání závodu tj. **27. srpna 2011** -  storno poplatek je **100,- Kč.**\r\n\r\nPodrobné informace najdete v "**prozicích závodu**":http://bck.webnode.cz/propozice/', 'www.bikeclubkralovice.cz', ' 43-817 603 0277 / 0100', '/img/kralovice/bikeclub_kralovice_200.jpg', 230, 0, 2, 'Cykloklub', 1, 1, NULL, 0, 0, NULL, 0, 0, '2011-12-21 22:06:36'),
(5, 0, 'Online registrace již není aktivní.', 'Author MTB Stupno', '2011-07-31', 'Stupno, okr. Rokycany', 'Poslední červencový den se budou sice lámat letní prázdniny do své druhé poloviny, ale u nás ve Stupně se budou lámat rekordy na již 3.ročníku Author MTB kriteriu. Finálový závod Poháru Plzeňského kraje Becker Cup 2011 www.beckercup.wgz.cz se pojede opět jako open Mistrovství Plzeňského kraje, to znamená, že vítězové v každé kategorii budou dekorováni originálním mistrovským dresem. Zázemí závodu, kancelář a občerstvení  je v areálu sportovního stadionu, technicky hravá trať je namotána po cestách, pěšinách a roklích přilehlého lesoparku. Jsou připraveny tři různé tratě, pouze naši nejmenší budou závodit a prohánět odrážedla v areálu.\r\n\r\nOn-line přihlašování je již samozřejmostí, a proto se můžete již nyní přihlašovat na webu www.ewitis.cz  každého přihlášeného předem do 27.7. odměníme speciálním dárkem a ušetří si čekání ve frontě při přihlašování a vypisování přihlášky.\r\n\r\nPřipravujeme společný trénink na trati závodu, tak sledujte informace na www.authorteam.cz  \r\nNa všechny závodnice a závoďáky se již těšíme 31.7. ve Stupně na shledanou.', 'Cílové časy\r\n======================\r\n\r\n- "Kategorie Žáci nejmladší":[http://ewitis.cz/competitions/2011_stupno/2011_stupno_zaci_nejmladsi.pdf]\r\n- "Kategorie Žákyně nejmladší":[http://ewitis.cz/competitions/2011_stupno/2011_stupno_zakyne_nejmladsi.pdf]\r\n\r\n- "Kategorie Žáci mladší":[http://ewitis.cz/competitions/2011_stupno/2011_stupno_zaci_mladsi.pdf]\r\n- "Kategorie Žákyně mladší":[http://ewitis.cz/competitions/2011_stupno/2011_stupno_zakyne_mladsi.pdf]\r\n\r\n- "Kategorie Žáci starší":[http://ewitis.cz/competitions/2011_stupno/2011_stupno_zaci_starsi.pdf]\r\n- "Kategorie Žákyně starší":[http://ewitis.cz/competitions/2011_stupno/2011_stupno_zakyne_starsi.pdf]\r\n\r\n- "Kategorie Kadeti":[http://ewitis.cz/competitions/2011_stupno/2011_stupno_kadeti.pdf]\r\n- "Kategorie Kadetky":[http://ewitis.cz/competitions/2011_stupno/2011_stupno_kadetky.pdf]\r\n\r\n- "Kategorie Kluci":[http://ewitis.cz/competitions/2011_stupno/2011_stupno_kluci.pdf]\r\n- "Kategorie Holky":[http://ewitis.cz/competitions/2011_stupno/2011_stupno_holky.pdf]\r\n\r\n- "Kategorie Žáci nábor":[http://ewitis.cz/competitions/2011_stupno/2011_stupno_zaci_nabor.pdf]\r\n- "Kategorie Žákyně nábor":[http://ewitis.cz/competitions/2011_stupno/2011_stupno_zakyne_nabor.pdf]\r\n\r\n\r\n- "Kategorie Veteráni A":[http://ewitis.cz/competitions/2011_stupno/2011_stupno_veterani_a.pdf]\r\n- "Kategorie Veteráni B":[http://ewitis.cz/competitions/2011_stupno/2011_stupno_veterani_b.pdf]\r\n\r\n- "Kategorie Muži A":[http://ewitis.cz/competitions/2011_stupno/2011_stupno_muzi_a.pdf]\r\n- "Kategorie Muži B":[http://ewitis.cz/competitions/2011_stupno/2011_stupno_muzi_b.pdf]\r\n\r\n\r\nČasy jednotlivých kol\r\n======================\r\n\r\n- "Kategorie Žáci nejmladší":[http://ewitis.cz/competitions/2011_stupno/kola/2011_stupno_zaci_nejmladsi.pdf]\r\n- "Kategorie Žákyně nejmladší":[http://ewitis.cz/competitions/2011_stupno/kola/2011_stupno_zakyne_nejmladsi.pdf]\r\n\r\n- "Kategorie Žáci mladší":[http://ewitis.cz/competitions/2011_stupno/kola/2011_stupno_zaci_mladsi.pdf]\r\n- "Kategorie Žákyně mladší":[http://ewitis.cz/competitions/2011_stupno/kola/2011_stupno_zakyne_mladsi.pdf]\r\n\r\n- "Kategorie Žáci starší":[http://ewitis.cz/competitions/2011_stupno/kola/2011_stupno_zaci_starsi.pdf]\r\n- "Kategorie Žákyně starší":[http://ewitis.cz/competitions/2011_stupno/kola/2011_stupno_zakyne_starsi.pdf]\r\n\r\n- "Kategorie Kadeti":[http://ewitis.cz/competitions/2011_stupno/kola/2011_stupno_kadeti.pdf]\r\n- "Kategorie Kadetky":[http://ewitis.cz/competitions/2011_stupno/kola/2011_stupno_kadetky.pdf]\r\n\r\n- "Kategorie Kluci":[http://ewitis.cz/competitions/2011_stupno/kola/2011_stupno_kluci.pdf]\r\n- "Kategorie Holky":[http://ewitis.cz/competitions/2011_stupno/kola/2011_stupno_holky.pdf]\r\n\r\n- "Kategorie Žáci nábor":[http://ewitis.cz/competitions/2011_stupno/kola/2011_stupno_zaci_nabor.pdf]\r\n- "Kategorie Žákyně nábor":[http://ewitis.cz/competitions/2011_stupno/kola/2011_stupno_zakyne_nabor.pdf]\r\n\r\n\r\n- "Kategorie Veteráni A":[http://ewitis.cz/competitions/2011_stupno/kola/2011_stupno_veterani_A.pdf]\r\n- "Kategorie Veteráni B":[http://ewitis.cz/competitions/2011_stupno/kola/2011_stupno_veterani_B.pdf]\r\n\r\n- "Kategorie Muži A":[http://ewitis.cz/competitions/2011_stupno/kola/2011_stupno_muzi_A.pdf]\r\n- "Kategorie Muži B":[http://ewitis.cz/competitions/2011_stupno/kola/2011_stupno_muzi_B.pdf]', '<object width="720" height="432">  <param name="movie" value="http://www.moab.cz/v/gaogfUQdjxz"></param>  <param name="allowFullScreen" value="true"></param>  <param name="allowscriptaccess" value="always"></param>  <embed src="http://www.moab.cz/v/gaogfUQdjxz" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="360" height="216"></embed></object>', 'On-line přihlašování je již samozřejmostí, a proto se můžete již nyní přihlašovat na webu www.ewitis.cz  každého přihlášeného předem do 27.7. odměníme speciálním dárkem a ušetří si čekání ve frontě při přihlašování a vypisování přihlášky.		\r\n\r\nZávod se jede dle pravidel BeckerCup: www.beckercup.wgz.cz/pravidla-p-a-l			\r\n\r\nStartovné:  kluci, holky a nábor zdarma, žáci nejml. - kadeti 50,- ostatní 100,- / záloha 50,-\r\n\r\nKancelář závodu od 8:00 v Sokolce, přihlášky nejpozději 1hod před startem příslušné kategorie.			\r\n\r\nVyhlášení výsledků ve 12:00 a po dojezdu kategorie mužů.			\r\n', '**Všechny platby budou provedeny až na místě!!**\r\n\r\nÚčastník svým přihlášením souhlasí s podmínkami závodu a prohlašuje, že:\r\n1. Bere na vědomí, že se závod jede za plného silničního provozu a že bude dodržovat jeho pravidla stanovená vyhláškou č. 30/2001 sb.\r\n2. Závodu se účastní na vlastní nebezpečí, s plnou ochranou přilbou.\r\n3. Není mu známa žádná překážka spočívající jeho zdravotním stavu, která by mu bránila ve startu.\r\n4. Bere na vědomí, že pořadatel závodu neodpovídá za případnou škodu na zdraví a věcech, pokud nebude prokázáno zavinění nebo pokud odložené věci nepřevzal do úschovy.\r\n5. Veškeré údaje, které zde závodník uvádí podléhají ustanovením zákona číslo 101/2000 Sb. o ochraně osobních údajů ve znění pozdějších novel. Pořadatel závodu je jediným vlastníkem informací. Tyto informace nejsou a nebudou prodávány, pronajímány ani jinak sdíleny s jinými subjekty\r\n', 'http://www.authorteam.cz', 'platba na místě', '/img/stupno/author_team_stupno_35.jpg', 98, 0, 1, 'Cykloklub', 1, 1, 'Mobilní telefon', 0, 0, NULL, 0, 0, '2011-11-09 23:25:44'),
(6, 0, 'Online registrace již není aktivní.', 'Horažďovické kolo 2011', '2011-08-28', 'Horažďovice, náměstí', '**POŘADATEL:** MTB Ježíkov Horažďovice + PLHK\r\n\r\n**ŘEDITEL ZÁVODU:** Bohumil Ježek\r\n\r\n**INFORMACE:** Josef Maxa, Horažďovice, e-mail: Maxbiker@seznam.cz\r\n\r\n\r\n\r\n', 'Skupiny\r\n======================\r\n\r\n- "Skupina 1":[http://ewitis.cz/competitions/2011_horazdovice/skupina_1.pdf]\r\n- "Skupina 2":[http://ewitis.cz/competitions/2011_horazdovice/skupina_2.pdf]\r\n\r\nKategorie\r\n======================\r\n\r\n- "Kategorie kadeti":[http://ewitis.cz/competitions/2011_horazdovice/kadeti.pdf]\r\n- "Kategorie junioři":[http://ewitis.cz/competitions/2011_horazdovice/juniori.pdf]\r\n- "Kategorie ženy":[http://ewitis.cz/competitions/2011_horazdovice/zeny.pdf]\r\n- "Kategorie veteráni 1":[http://ewitis.cz/competitions/2011_horazdovice/veterani_1.pdf]\r\n- "Kategorie veteráni 2":[http://ewitis.cz/competitions/2011_horazdovice/veterani_2.pdf]\r\n\r\n\r\n- "Kategorie muži 1":[http://ewitis.cz/competitions/2011_horazdovice/muzi_1.pdf]\r\n- "Kategorie muži 2":[http://ewitis.cz/competitions/2011_horazdovice/muzi_2.pdf]\r\n', '', '', '', '', '', NULL, 0, 0, 1, NULL, 0, 0, NULL, 0, 0, NULL, 0, 0, '2011-08-28 21:32:55'),
(7, 0, 'Online registrace již není aktivní. Můžete se zaregistrovat 1.10.2011 před závodem.', 'KřápKap Třemošná 2011', '2011-10-01', 'Třemošná', 'Sdružení TŘEMZET pořádá 1.10.2011 KřápKap Třemošná\r\n\r\nBez věkové hranice, bez Ř.P., přihlášení na webu i na místě, čísla na místě.\r\nStartovné 200,-.\r\nTrať je tréninková motokrosová takřka na rovině, dlouhá cca 1000m. Pár skoků, některé\r\nse dají objet, sem-tam zatáčka, klopenky.\r\nStartující se zúčastňují závodu výhradně na své riziko. Za jezdce mladší 18 let, zodpovídá zákonný zástupce.\r\n\r\nPRAVIDLA\r\n********\r\n\r\nPovinná výbava jezdců\r\n-----------------------\r\nHelma, kotníková pevná obuv, dlouhé kalhoty, dlouhé rukávy.\r\n\r\n<A NAME="klasik"></A>\r\nKategorie KLASIK\r\n---------\r\nNeupravené moto, tak jak bylo vyráběno. Povoleny pouze úpravy blatníků, sekundárního převodu, pláště do terénu(drapáky). Možno demontovat části kapotáže a světla(odlehčovací kůra). Max.vrtání válce průměr 40mm = osmý brus.\r\n\r\n<A NAME="special"></A>\r\nKategorie SPECIÁL\r\n---------\r\nUpravené moto, ovšem pouze s motorovým základem JAWA 50 PIONÝR.Tj. motor vzduchem chlazený, možnost zvětšení chladících ploch válce a hlavy, max. průměr vrtání 40mm = osmý brus při zachování továrního zdvihu a rozteče šroubů válce a hlavy. Úpravy uvnitř válce pouze co dovolí tovární odlitek válce a karterů. Převodovka třístupňová s možností změny převodových poměrů jednotlivých stupňů, primární převod a spojka jen do origo víka spojky. Sekundární převod volný. Zapalování, karburátor a výfuk volné.\r\n\r\n<A NAME="veteran"></A>\r\nKategorie VETERÁN\r\n---------\r\nŽivočich starší 40ti let na čemkoli z obou kategorií s tím, že ti co drží hladovku budou dohmotněni do váhy nejtěžšího VETERÁNA vhodným materiálem!!!\r\n\r\n<A NAME="pitbike_junior"></A>\r\nKategorie PITBIKE JUNIOR\r\n---------\r\ndo 15 let, do objemu motoru 125ccm\r\n\r\n<A NAME="pitbike_open"></A>\r\nKategorie PITBIKE OPEN\r\n---------\r\nnad 15 let, do objemu motoru 160ccm\r\n\r\n\r\nPROGRAM\r\n******************\r\n\r\n- 7.00 – 9.00 - Technická přejímka, registrace, seznámení s tratí\r\n- 9.15 – 9.30 – Rozprava\r\n- 10.00 – 10.20 – Rozjížďka kategorie KLASIK - 15min.+2kola\r\n- 10.35 – 10.55 – Rozjížďka kategorie PITBIKE JUNIOR - 15min.+2kola\r\n- 11.10 – 11.30 – Rozjížďka kategorie SPECIÁL - 15min.+2kola\r\n- 11.45 – 12.05 – Rozjížďka kategorie PITBIKE OPEN první - 15min.+2kola\r\n- 12.20 – 12.40 – Rozjížďka kategorie VETERÁN - 15min.+2kola\r\n- 12.55 – 13.15 – Rozjížďka kategorie PITBIKE OPEN druhá - 15min.+2kola\r\n\r\nPostupujícími do finále budou první až desátí umístění v rozjížďkách jednotlivých kategorií.V případě nižšího počtu startujících pojedou všichni.\r\n\r\n- 14.05 – Start finále kategorie KLASIK - 10 kol\r\n- 14.40 – Start finále kategorie PITBIKE JUNIOR - 10 kol\r\n- 15.15 – Start finále kategorie SPECIÁL - 10 kol\r\n- 15.50 – Start finále kategorie PITBIKE OPEN - 10 kol\r\n- 16.30 – Start finále kategorie VETERÁN - 10 kol\r\n- 17.50 – 18.15 - Vyhlášení výsledků\r\n\r\nObčerstvení zajištěno po celou dobu konání podniku (do vyjedení a vypití zásob)!!!\r\n\r\nBližší info: rota.z@seznam.cz\r\n\r\n\r\n', 'Časy finálových jízd\r\n======================\r\n\r\n- "Kategorie Klasik":[http://ewitis.cz/competitions/2011_fichtl/kategorie_klasik.pdf]\r\n- "Kategorie Pitbike Junior":[http://ewitis.cz/competitions/2011_fichtl/kategorie_pitbike_junior.pdf]\r\n- "Kategorie Speciál":[http://ewitis.cz/competitions/2011_fichtl/kategorie_special.pdf]\r\n- "Kategorie Pitbike Open":[http://ewitis.cz/competitions/2011_fichtl/kategorie_pitbike_open.pdf]\r\n- "Kategorie Veterán":[http://ewitis.cz/competitions/2011_fichtl/kategorie_veteran.pdf]', '<iframe width="540" height="304" src="http://www.youtube.com/embed/trNUXdmNL-0" frameborder="0" allowfullscreen></iframe>\r\n<br/><br/>\r\n<iframe src="http://www.rajce.net/a4753960/mini?bgcolor=&photoNameVisible=0" name="rajce-net" width="356" height="356" frameborder="0" scrolling="no" allowtransparency="false"></iframe>', 'Bez věkové hranice, bez Ř.P., přihlášení na webu i na místě, čísla na místě.\r\n\r\nTrať je tréninková motokrosová takřka na rovině, dlouhá cca 1000m. Pár skoků, některé se dají objet, sem-tam zatáčka, klopenky. \r\nStartující se zúčastňují závodu výhradně na své riziko. Za jezdce mladší 18 let, zodpovídá zákonný zástupce.', '', 'http://www.jawa50zavody.wz.cz/tremosna.htm', '0999253053/0800', NULL, 39, 0, 1, NULL, 0, 0, NULL, 0, 0, NULL, 0, 0, '2011-11-10 21:51:08'),
(8, 0, 'Online registrace již není aktivní.\r\n\r\nStále je možné se registrovat v místě závodu více viz "**prozice závodu**":http://www.blizak.cz/files/Blizak_2012_propozice.pdf', 'Blizák 2012', '2012-06-16', 'Sázava, okr. Benešov', 'Letos pořádáme **12. ročník** cyklistického klání, kde si dravci šáhnou na dno svých sil a přátelé náročného ježdění přírodou si užijí. Obě tratě závodu, na **40** nebo **80 km** se derou po stráních od řeky Sázavy vzhůru aby se ve sjezdech zase vracely zpět. To je prošpikováno několika brody přes sázavské přítoky, pěšinkami, lesními cestami a tu a tam nějakým asfaltem. A kdo má dost sil, užije si i krásný výhled po krajině.\r\n\r\n80 km je určeno pro cyklisty, kteří vědí jak hospodařit ze silami a mají už něco najeto. Trať kratší může ujet každý, kdo na kole rád jezdí a ví, o co při horském ježdění jde. Naši sponzoři se podílejí na tom, aby řeka a město Sázava mělo cyklistům co nabídnout. Startuje a dojíždí se ve městě Sázava, kam se dostanete z 34 km dálnice D1. V cíli je dostatek stínu, občerstvení, a pro vítěze hodnotné ceny. O to, aby vše proběhlo v pořádku se stará 130 pořadatelů a jedna nebo tři občerstvovací stanice – podle délky tratě. Každý, kdo může se na tento závod každý rok vrací.', '', '', 'Podrobné informace o registraci najdete v "**prozicích závodu**":http://www.blizak.cz/files/Blizak_2012_propozice.pdf \r\n\r\n', '\r\n', 'http://www.blizak.cz/', '1597379053/0800', '/img/blizak/blizak_2012_vyrez_small.jpg', 4, 1000, 1, 'Adresa <br/><span>(město, ulice, psč)</span>', 1, 0, 'Cykloklub', 0, 1, NULL, 0, 0, '2012-02-27 20:30:03'),
(9, 1, 'Online registrace již není aktivní.\r\n\r\nStále je možné se registrovat v místě závodu více viz "**prozice závodu**":http://pohar-peruna.cz/zavody/perstejnsko-giro/', 'Perštejnské Giro 2012', '2012-05-05', 'Perštejn ', 'Pro všechny, kdo mají rádi jízdu na horském kole, připravil *Team Bike Perštejn* ve spolupráci s obcí Perštejn šestý ročník závodu horských kol. Na závodníky čeká zcela nově přepracovaná trať, která zcela jistě nadchne všechny milovníky horských kol. Pro ty, co na kolo nesedají pravidelně, je připravena 14 kilometrová výrazně lehčí trať, na které mohou poměřit své síly s ostatními. Pro malé závodníky máme připraven dětský závod. To vše v krásném prostředí Perštejna a okolí. Zázemí závodu se nachází v areálu perštejnského fotbalového hřiště a koupaliště. A tak nezbývá než dodat…vezměte rodinu a přijeďte k nám prožít příjemnou sobotu. V uplynulém ročníku Poháru Peruna se na start našeho závodu postavilo na 312 malých i velkých závodníků.\r\n\r\n**Ceny a tombola:** První 3 závodníci v každé kategorii budou slavnostně vyhlášeni a obdrží diplom a pohár. Každý účastník obdrží po odevzdání startovního čísla poukázky na občerstvení po závodu. Po vyhlášení výsledků proběhne tombola o věcné ceny. Do slosování budou zařazena všechna startovní čísla závodníků závodu.\r\n', '', '', 'Podrobné informace o registraci najdete v "**prozicích závodu**":http://pohar-peruna.cz/zavody/perstejnsko-giro/ \r\n', '- **cena 1** platí **pro online registraci a následnou platbu**\r\n- **cena 2** potom **na místě**', 'http://pohar-peruna.cz/zavody/perstejnsko-giro/', '215095932/0300', '/img/giro/giro.jpg', 0, 1000, 2, 'Cykloklub', 0, 1, 'Jídlo <br/><span>(rizoto nebo guláš)</span>', 1, 0, NULL, 0, 0, '2012-02-26 19:01:01');
